// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

error EquityManager__TotalValueGreaterThan100();
error EquityManager__StakeIsZero();
error EquityManager__TransactionFailed();
error EquityManager__InsufficientBalance();

/// @custom:security-contact info@impact3.io
contract EquityManager is Pausable, AccessControl, ReentrancyGuard {
    using SafeMath for uint256;

    event FundsReceived(address indexed addr, uint256 amount);
    event FundsDistributed(uint256 amount);
    event EquityStakeUpdated(uint256 count, uint256 timeUpdated);
    event NewStakeHolderAdded(
        address holder,
        uint256 stake,
        uint256 stakeholderNum,
        uint256 timeAdded
    );

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MANAGER_ROLE = keccak256("MANAGER_ROLE");

    struct EquityStake {
        address holder;
        uint256 stakePercentage;
        uint256 lastReceived;
        uint256 created;
    }

    EquityStake[] public Istakeholders;
    EquityStake[] public Cstakeholders;
    uint256 public stakeholderCount;
    uint256 counter = 0;
    address payable public i3Fund;
    uint256 cumfundsDistributed = 0;
    uint256 cumfundsToI3 = 0;
    uint256 public immutable i_interval;
    uint256 private s_lastTimeStamp;

    constructor(address _i3Fund, uint256 _interval) {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);
        _grantRole(MANAGER_ROLE, msg.sender);
        setFund(_i3Fund);
        i_interval = _interval;
        s_lastTimeStamp = block.timestamp;
    }

    /////////////////////
    // Main Functions //
    /////////////////////

    function setFund(address fund) public onlyRole(MANAGER_ROLE) nonReentrant {
        i3Fund = payable(fund);
    }

    /*
     * @notice Method for distributing funds
     * @notice equity stake is updated at the every stipulated interval
     */
    function distributeFunds() public whenNotPaused nonReentrant {
        uint256 fundsToDistribute = address(this).balance;
        //bool incrStake = timePassed();
        Cstakeholders = updateStake();
        EquityStake[] memory equityStakeHolders = Cstakeholders;
        for (uint256 i = 0; i < stakeholderCount; i++) {
            uint256 amount = fundsToDistribute
                .mul(equityStakeHolders[i].stakePercentage)
                .div(100 * (10**18));
            equityStakeHolders[i].lastReceived = block.timestamp;
            cumfundsDistributed += amount;
            sendValue(payable(equityStakeHolders[i].holder), amount);
        }
        cumfundsToI3 += address(this).balance;
        sendValue(i3Fund, address(this).balance);
        emit FundsDistributed(cumfundsDistributed);
    }

    function totalStake(EquityStake[] memory _stakeholders)
        public
        view
        returns (uint256)
    {
        uint256 _totalStake = 0;
        for (uint256 i = 0; i < stakeholderCount; i++) {
            _totalStake += _stakeholders[i].stakePercentage;
        }
        return _totalStake;
    }

    /*
     * @notice Method for adding new stakeholder
     * @notice Only the manager can call this funtion
     * @param holder, new stakeholder's address
     * @param stake, new stakeholder's stake in %
     */
    function addHolder(address holder, uint256 stake)
        public
        whenNotPaused
        onlyRole(MANAGER_ROLE)
    {
        if (totalStake(updateStake()).add(stake) > (100 * (10**18))) {
            // 100%
            revert EquityManager__TotalValueGreaterThan100();
        }

        if (stake <= 0) {
            revert EquityManager__StakeIsZero();
        }
        Istakeholders.push(
            EquityStake(holder, stake, block.timestamp, block.timestamp)
        );
        Cstakeholders.push(
            EquityStake(holder, stake, block.timestamp, block.timestamp)
        );
        stakeholderCount++;
        emit NewStakeHolderAdded(
            holder,
            stake,
            stakeholderCount,
            block.timestamp
        );
    }

    function sendValue(address payable recipient, uint256 amount) internal {
        if (address(this).balance < amount) {
            revert EquityManager__InsufficientBalance();
        }
        (bool success, ) = recipient.call{value: amount}("");
        if (!success) {
            revert EquityManager__TransactionFailed();
        }
    }

    function timePassed() internal returns (bool) {
        bool timepassed = ((block.timestamp - s_lastTimeStamp) >= i_interval);
        if (timepassed) {
            s_lastTimeStamp = block.timestamp;
            return true;
        }
        return false;
    }

    /*
     * @notice Internal function for updating equity stake
     * @notice It checks whether the total stake > 100
     */
    function updateStake() internal returns (EquityStake[] storage) {
        EquityStake[] storage maxEquityStake = Cstakeholders;
        EquityStake[] storage testEquityStake = Cstakeholders;

        if (timePassed()) {
            EquityStake[] memory Iequitystake = Istakeholders;
            for (uint256 i = 0; i < Cstakeholders.length; i++) {
                testEquityStake[i].stakePercentage += Iequitystake[i]
                    .stakePercentage;
            }
            if (totalStake(testEquityStake) <= 100) {
                counter++;
                emit EquityStakeUpdated(counter, block.timestamp);
                return testEquityStake;
            }
            return maxEquityStake;
        }
        return Cstakeholders;
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    function deposit() external payable {
        emit FundsReceived(msg.sender, msg.value);
    }

    /////////////////////
    // Getter Functions //
    /////////////////////

    /*
     * @notice Function for getting stakeholders and
     * their current equity stake
     */
    function currentStakeHolders()
        external
        view
        returns (address[] memory _holders, uint256[] memory _stakesPercent)
    {
        EquityStake[] memory equitystake = Cstakeholders;
        _holders = new address[](equitystake.length);
        _stakesPercent = new uint256[](equitystake.length);
        for (uint256 i = 0; i < equitystake.length; i++) {
            _holders[i] = equitystake[i].holder;
            _stakesPercent[i] = equitystake[i].stakePercentage;
        }

        return (_holders, _stakesPercent);
    }

    function contractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function Impact3Account() external view returns (address) {
        return i3Fund;
    }

    function PauserRole() external pure returns (bytes32) {
        return PAUSER_ROLE;
    }

    function equityUpdateInterval() external view returns (uint256) {
        return i_interval;
    }

    function stakeUpdatedXtimes() external view returns (uint256) {
        return counter;
    }

    function fundsDistributedToDate() external view returns (uint256) {
        return cumfundsDistributed;
    }

    function fundsSentToI3() external view returns (uint256) {
        return cumfundsToI3;
    }
}

